import React from 'react';
import logo from '.../logo.svg';


function Image() {
    return (
      <div>
        <div>
            <h3>Meme Owner</h3>
            <p>Caption is too lit.</p>
            <img src="{logo}"/>
        </div>
      </div>
    );
  }


export default Image;
